CREATE TABLE store_order_discounts (
  id INT AUTO_INCREMENT PRIMARY KEY,
  order_id INT NOT NULL,
  discount_id INT NULL,
  code VARCHAR(50) NOT NULL,
  type ENUM('percent','fixed') NOT NULL,
