EXECUTE stmt;
DEALLOCATE PREPARE stmt;

SET @chapter_sort_sql = IF(@chapter_sort_exists = 0, 'ALTER TABLE chapters ADD COLUMN sort_order INT NOT NULL DEFAULT 0', 'SELECT 1');
